import React from "react";
import "./Table.css";

function Table(props) {
  const tableData = [
    ["", "Autumn1", "Autumn2", "Autumn3", "Autumn4", "Autumn5", "Autumn6"],
    ["EYFS", "", "", "", "", "", ""],
    ["KSY1", "", "", "", "", "", ""],
    ["KSY2", "", "", "", "", "", ""],
    ["KSY3", "", "", "", "", "", ""]
  ];

  const tableRows = tableData.map((rowData, index) => {
    const cells = rowData.map((cellData, cellIndex) => (
      <td key={cellIndex} onDrop={props.onDrop} onDragOver={props.onDragOver}>
        {cellData}
      </td>
    ));

    return <tr key={index}>{cells}</tr>;
  });

  return (
    <div>
      <table>
        <thead>
          <tr>{tableRows[0]}</tr>
        </thead>
        <tbody>{tableRows.slice(1)}</tbody>
      </table>
    </div>
  );
}

export default Table;
